  {<BarCategory/>}  {/*TOP20 */} 








        <div className="row"> 
          <div className="col-sm-3">{<AddBook/>}</div>
          <div className="col-sm-9">{<Ads/>}</div> 
        </div>
         
         
         
         

         
      
        <div className="row"> 
          <div className="col-sm-3">{<BlocMotivation/>}</div>
          <div className="col-sm-9">{<UserBooks/>}</div> 

        </div> 









          {<AvisClients/>}
         </Router>
      </div>
      </React.Fragment>


  )
    }}



